// src/pages/Features.js
import React from 'react';
import styled from 'styled-components';

// Container for centering content
const FeaturesContainer = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  min-height: 60vh;  // Adjust as needed
  text-align: center;  // Center text within the container
  padding: 20px;
`;

const Title = styled.h1`
  font-size: 2.5em;
  margin-bottom: 20px;
  color: #333;
`;

const Description = styled.p`
  font-size: 1.2em;
  margin-bottom: 40px;
  color: #666;
`;

const FeatureGrid = styled.div`
  display: grid;
  grid-template-areas: 
    "card1 card2 card3 . . . . ."
    "card4 card5 . . . . . ."
    "card6 card7 card8 . . . . .";
  grid-template-columns: repeat(8, 1fr);
  grid-template-rows: auto auto auto;
  gap: 20px;
  width: 100%;
  max-width: 1200px;

  // Responsive adjustments
  @media (max-width: 1200px) {
    grid-template-areas: 
      "card1 card2 card3 card4 card5 . . ."
      "card6 card7 card8 . . . . .";
    grid-template-columns: repeat(4, 1fr);
    grid-template-rows: auto auto;
  }

  @media (max-width: 800px) {
    grid-template-areas: 
      "card1 card2"
      "card3 card4"
      "card5 card6"
      "card7 card8";
    grid-template-columns: repeat(2, 1fr);
    grid-template-rows: auto auto auto auto;
  }

  @media (max-width: 500px) {
    grid-template-areas: 
      "card1"
      "card2"
      "card3"
      "card4"
      "card5"
      "card6"
      "card7"
      "card8";
    grid-template-columns: 1fr;
    grid-template-rows: auto;
  }
`;

const FeatureCard = styled.div`
  background-color: #ffffff;
  border-radius: 12px;
  padding: 20px;
  box-shadow: 0 8px 12px rgba(0, 0, 0, 0.1);
  transition: transform 0.3s ease, box-shadow 0.3s ease;

  &:hover {
    transform: translateY(-10px);
    box-shadow: 0 16px 24px rgba(0, 0, 0, 0.2);
  }
`;

const FeatureTitle = styled.h3`
  font-size: 1.5em;
  margin-bottom: 10px;
  color: #222;
`;

const FeatureDescription = styled.p`
  font-size: 1em;
  color: #444;
`;

function Features() {
  return (
    <FeaturesContainer>
      <Title>Features</Title>
      <Description>Explore the features of CODEV and learn how it can assist you.</Description>
      <FeatureGrid>
        <FeatureCard style={{ gridArea: 'card1' }}><FeatureTitle>Feature 1</FeatureTitle><FeatureDescription>Description for feature 1</FeatureDescription></FeatureCard>
        <FeatureCard style={{ gridArea: 'card2' }}><FeatureTitle>Feature 2</FeatureTitle><FeatureDescription>Description for feature 2</FeatureDescription></FeatureCard>
        <FeatureCard style={{ gridArea: 'card3' }}><FeatureTitle>Feature 3</FeatureTitle><FeatureDescription>Description for feature 3</FeatureDescription></FeatureCard>
        <FeatureCard style={{ gridArea: 'card4' }}><FeatureTitle>Feature 4</FeatureTitle><FeatureDescription>Description for feature 4</FeatureDescription></FeatureCard>
        <FeatureCard style={{ gridArea: 'card5' }}><FeatureTitle>Feature 5</FeatureTitle><FeatureDescription>Description for feature 5</FeatureDescription></FeatureCard>
        <FeatureCard style={{ gridArea: 'card6' }}><FeatureTitle>Feature 6</FeatureTitle><FeatureDescription>Description for feature 6</FeatureDescription></FeatureCard>
        <FeatureCard style={{ gridArea: 'card7' }}><FeatureTitle>Feature 7</FeatureTitle><FeatureDescription>Description for feature 7</FeatureDescription></FeatureCard>
        <FeatureCard style={{ gridArea: 'card8' }}><FeatureTitle>Feature 8</FeatureTitle><FeatureDescription>Description for feature 8</FeatureDescription></FeatureCard>
      </FeatureGrid>
    </FeaturesContainer>
  );
}

export default Features;
